// Създайте файл TestAdmin.jsx в папката pages
import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

function TestAdmin() {
  const { user, userRole, isSuperAdmin, isRestaurantAdmin, supabase } = useAuth();

  const checkRoleDirectly = async () => {
    if (!user) return "Не сте влезли в акаунта си";
    
    try {
      // Опит за директна проверка в базата данни
      const { data, error } = await supabase
        .from('user_roles')
        .select('role')
        .eq('user_id', user.id)
        .single();
      
      if (error) return `Грешка: ${error.message}`;
      return `Роля директно от базата: ${data?.role || 'няма'}`;
    } catch (err) {
      return `Грешка: ${err.message}`;
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h1>Тест на администраторски права</h1>
      
      <div style={{ background: '#f0f0f0', padding: '15px', borderRadius: '5px', marginBottom: '20px' }}>
        <h3>Информация за текущия потребител:</h3>
        <p><strong>Влезли ли сте:</strong> {user ? 'Да' : 'Не'}</p>
        <p><strong>Email:</strong> {user?.email || 'N/A'}</p>
        <p><strong>User ID:</strong> {user?.id || 'N/A'}</p>
        <p><strong>userRole обект:</strong> {JSON.stringify(userRole) || 'null'}</p>
        <p><strong>Роля от userRole:</strong> {userRole?.role || 'няма'}</p>
        <p><strong>isSuperAdmin():</strong> {isSuperAdmin ? (isSuperAdmin() ? 'Да' : 'Не') : 'функцията не съществува'}</p>
        <p><strong>isRestaurantAdmin():</strong> {isRestaurantAdmin ? (isRestaurantAdmin() ? 'Да' : 'Не') : 'функцията не съществува'}</p>
        <p><strong>Директна проверка в DB:</strong> <button onClick={async () => {
          const result = await checkRoleDirectly();
          document.getElementById('db-result').innerText = result;
        }}>Провери</button> <span id="db-result"></span></p>
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h3>Линкове:</h3>
        <p><Link to="/admin" style={{ color: 'blue', fontWeight: 'bold' }}>Към админ панела</Link></p>
        <p><Link to="/" style={{ color: 'blue' }}>Към начална страница</Link></p>
      </div>

      <div style={{ marginTop: '30px', borderTop: '1px solid #ddd', paddingTop: '20px' }}>
        <h3>Инструкции за отстраняване на проблеми:</h3>
        <ol>
          <li>Проверете дали userRole обектът съдържа правилната информация</li>
          <li>Проверете дали функциите isSuperAdmin() и isRestaurantAdmin() връщат правилните стойности</li>
          <li>Проверете директния резултат от базата данни</li>
          <li>Ако директният резултат показва правилната роля, но userRole не я съдържа, проблемът е във fetchUserRole функцията в AuthContext</li>
        </ol>
      </div>
    </div>
  );
}

export default TestAdmin;
